import React from 'react'
import Person from './Person'

function PersonList() {

    const persons = [

        {
            id: 1,
            name: 'A',
            age: 10
        },

        {
            id: 2,
            name: 'B',
            age: 20
        },

        {
            id: 3,
            name: 'C',
            age: 30
        }
    ]

    const personList = persons.map(person => <Person person={person} />)
    return <div>{personList}</div>

}

export default PersonList
